.complete{
    display: flex;
    justify-content: center;
    height: 32vw;
}


.container{
    display: flex;
    justify-content: center;
    flex-direction: column;
    align-items: center;
}
.gamedetails{
    /* background-color: cyan; */
    padding: 1vw;
    font-family: 'Baloo Bhaina 2', cursive;
    font-size: 1vw;
    display: flex;
    justify-content: center;
}

.welcome{
    display: flex;
    justify-content: center;
}

.info{
    font-size: 2vw;
    
}

.game{
    display: grid;
    grid-template-columns: repeat(3,9vw);
    grid-template-rows: repeat(3.9vw);
    font-family: 'Road Rage', cursive;
    height: 20vw;
    /* width: 22.5vw; */
    
}

.box{
    border: 1px solid black;
    font-size: 2vw;
    display: flex;
    justify-content: center;
    align-items: center;
    font-family: 'Baloo Bhaina 2', cursive;
}

.box:hover{
    background-color: #7FB1C9;
    cursor: pointer;
}

.images1 img,.images2 img{
    width: 0;
    transition: width 1s ease-in-out;
}

button{
    font-size: 1.5vw;
}

.bl-0{
    border-left: 0;
}

.br-0{
    border-right:0;
}
.bt-0{
    border-top: 0;
}
.bb-0{
    border-bottom: 0;
}

.reset{
    cursor: pointer;
    border-radius: 0.3vw;
    padding: 0.5vw;
    font-weight: bold;
}

.line{
    background-color: black;
    width: 0vw;
    height: 2px;
    position: absolute;
}
